import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./QuizDashboard.css";

const QuizDashboard = () => {
  const navigation = useNavigate();
  const [quizQns, setQuizQns] = useState([]);
  const [countQuiz, setCountQuiz] = useState({
    QuizQuestion: Number(""),
    QuizOtions: Number(""),
  });
  const [createQuiz, setCreateQuiz] = useState(false);
  const handleLogout = () => {
    navigation("/");
  };

  const handleCreateQuiz = () => {
    console.log("Hello");
    setCreateQuiz((pre) => !pre);
  };
  console.log(createQuiz);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setCountQuiz({...countQuiz, [name]: Number(value) });
  }

  const { QuizQuestion, QuizOtions } = countQuiz;

  return (
    <div className="dashboard-container">
      <div className="header">
        <div className="user-greeting">Hello, Kishan</div>
        <button className="logout-btn" onClick={handleLogout}>
          Logout
        </button>
      </div>
      <div className="content">
        <h2>Welcome to the Quiz Dashboard</h2>
        {/* Add your quiz content here */}
        <button className="create-quiz-btn" onClick={handleCreateQuiz}>
          Create Quiz
        </button>
        {createQuiz ? (
          // Add your quiz creation form here
          <>
            <div>
              <p>How Many Questions</p>
              <input
                type="number"
                placeholder="Questions"
                name="QuizQuestion"
                value={QuizQuestion}
                onChange={handleInputChange}
              />
              <p>How many Option for Each Questions</p>
              <input
                type="number"
                placeholder="Option for each Question"
                name="QuizOptions"
                value={QuizOtions}
                onChange={handleInputChange}
              />
            </div>
          </>
        ) : (
          // Add your quiz list here
          <ul>
            {quizQns.map((quiz) => (
              <li key={quiz._id}>{quiz.title}</li>
            ))}
          </ul>
        )}
      </div>
    </div>
  );
};

export default QuizDashboard;
